import React, { Component } from 'react';

export default class CreateExercise extends Component {

  state = {
    username: '',
    description: '',
    duration: 0,
    date: new Date(),
    users: []
  }


  componentDidMount = () => {
    this.setState({
      users: ["test user"],
      username: "test user"
    })
  }

  onChangeUsername(e) {
    this.state.username({
      username: e.target.value
    })
  }

  onChangeDescription(e) {
    this.state.username({
      description: e.target.value
    })
  }

  onChangeDuration(e) {
    this.state.username({
      duration: e.target.value
    })
  }
  onChangeDate(date) {
    this.state.username({
      date: date
    })
  }

  onSubmit(e) {
    e.preventDefault();

    const exercise = {
      username: this.state.username,
      description: this.state.description,
      duration: this.state.duration,
      date: this.state.date
    }
  }

  render() {
    return (
      <div>
        <p>You are on the CreateExercise component!</p>
      </div>
    )
  }
}
